import actions from './actions';

const {RESET_PASSWORD} = actions;

const initState = {
    loading: false,
    error: null,
    data: null
}
const ResetPasswordReducer = (state = initState, action) => {
    const {type, data, err} = action;
    switch (type) {
        case RESET_PASSWORD:
            return {
                ...state,
                loading: true,
                data: data,
                error: err
            }
        default:
            return state;
    }
}
